import Link from 'next/link'
import Layout from '../components/Layout'
const PostLink = (props) => (
    <li>
        <Link as={`/p/${props.id}`} href={`/post?id=${props.id}`}>
            <div>{props.id}</div>
        </Link>

        <style jsx>
            {`
                li{
                    text-align:center;
                }
            `}
        </style>
    </li>
)
export default () => (
    <Layout title={'Index'}>
        <h1>Hello</h1>
        <ul>
            <PostLink id="hello-nextjs"/>
            <PostLink id="learn-nextjs"/>
            <PostLink id="deploy-nextjs"/>
        </ul>
        <div className='haha'>
            <p className='xixi'>pick pick pick</p>
        </div>


        <style jsx Global>
            {`
                h1{
                    text-align:center;
                }    
                ul{
                    text-align:center;
                }
               
            `}
        </style>
    </Layout>
)
